comment_text:
:: I've been to the Intercontinental Hotel Bali; it's not that impressive; the whole south of the island is over-developed. Much nicer is the Maya; 
 ::* http://www.mayaubud.com/ 
 :: Anyway, I see that most of this is 's work your going rather rough on. I mentioned the Maya because it's an award-winning design, but for most hotels, it's just cookie-cutter cement boxes by the millions, so it's *not* about the structure, it's about the chains, and it's about location, location, location. You say this is 'approved' but I only see a few comments, and about half are yours. Was this related to Blofeld's 'retirement'? A seized moment? I spoke with Jimbo about that, and he told that it's 'fixed'. So, Dr. B. is know for creating a huge number of articles, and I would expect him to create sufficient numbers to justify categorization at a fairly fine granularity. In Ubud, alone, there are easily a dozen major high-end hotels and hundreds of more modest accommodations. There are hundreds of high-end places on the island. My objection is that you've done like 500 edits in the last two days, regrading the entire landscape of what's in place. Hotels and such are not primarily 'structures' they're about accommodation and hospitality, and for the most part to cast them as 'structures' is rather crude. Dr. B. creates articles such as Amanjiwo, so please show some respect for the structure (pun noted) of things he's put in place. Regards,

